#include <generate/base_time_mask.frag>
// Shader downloaded and adapted from glslsandbox.com
// URL: http://glslsandbox.com/e#45513.0

#ifdef GL_ES
precision mediump float;
#endif


uniform vec2 mouse;
uniform float uAlpha; // {"default" : 1.0, "range" : [0.0, 1.0]}
uniform float uScale; // {"default" : 1.0}
uniform float uBackgroundBorder; // {"default" : 0.8, "range" : [0.0, 1.0]}

uniform float uRotation;
uniform float uMirrorRotation;

uniform float uDisplacement; // {"default" : 1.0, "range" : [-1.0, 1.0]}

vec3 rotatex(in vec3 p, float ang) {	
	return vec3(p.x, p.y*cos(ang) - p.z*sin(ang), p.y*sin(ang) + p.z*cos(ang)); 
}
vec3 rotatey(in vec3 p, float ang) {	
	return vec3(p.x*cos(ang) - p.z*sin(ang), p.y, p.x*sin(ang) + p.z*cos(ang)); 
}
vec3 rotatez(in vec3 p, float ang) {	
	return vec3(p.x*cos(ang) - p.y*sin(ang), p.x*sin(ang) + p.y*cos(ang), p.z); 
}

vec2 uvToPolar(vec2 uv) {
    ivec2 size = textureSize(uInputTexture, 0);
    //vec2 texCoords = (uv - vec2(0.5)) * 2.0;
    //texCoords.x *= float(size.x) / float(size.y);
    vec2 texCoords = uv;

    float radius = length(texCoords);
    // this was an accident: interesting WTF
    // float angle = radians(atan(texCoords.y, texCoords.x)) + 3.141595;
    float angle = atan(texCoords.y, texCoords.x) + 3.141595;

    return vec2(angle, radius);
}

vec2 polarToUV(vec2 polar) {
    vec2 uv;
    uv.x = polar.y * cos(polar.x);
    uv.y = polar.y * sin(polar.x);
    //uv = (uv + vec2(1.0)) / 2.0;
    return uv;
}

vec2 polarMirror(vec2 polar, float n, float angleOffset) {
    float modAngle = radians(360.0) / n;
    polar.x = mod(polar.x + angleOffset, modAngle);
    if (polar.x > modAngle / 2) {
        polar.x = modAngle - polar.x;
    }
    return polar;
}

float scene(vec3 p)
{
	p = rotatey(p, 0.3*uRotation);
	p = rotatex(p, 0.2*uRotation);
	p = rotatez(p, 0.4*uRotation);

	//p = rotatey(p, 0.3*uRotation);
	//p = rotatex(p, 0.2*uRotation);
	//p = rotatez(p, 0.4*uRotation);

	float mirrorRotation = uMirrorRotation * 0.1;
	p = rotatex(p, 0.8 * mirrorRotation + 4.73);
	p = rotatey(p, mirrorRotation);
	p = rotatez(p, -0.5 * mirrorRotation - 2.76);
	p.xz = polarToUV(polarMirror(uvToPolar(p.xz), 8.0, 0.0));
	p = rotatez(p, -(-0.5 * mirrorRotation - 2.76));
	p = rotatey(p, -mirrorRotation);
	p = rotatex(p, -(0.8 * mirrorRotation + 4.73));

	float displace = clamp(sin((p.x+p.y+p.z)*20.0)*0.03, 0.0, 1.0);
	float boxish = length(max(abs(p) - 0.5, 0.0)) - 0.01 + displace * uDisplacement; 
	float sphere = length(p) - 0.5;

	float t = pyvisualTime;
	// make mix factor go from -1 to 0.5
	// (only 0.5 because I don't want pure sphere)
	float alpha = mix(-1.0, 0.5, sin(t)*0.5+0.5);
	return mix(boxish, sphere, alpha);
//	return sin(min(d0,d1)*1.6); 
//	return length(p) - 1.0; 
}

vec3 get_normal(vec3 p)
{
	vec3 eps = vec3(0.01, 0.0, 0.0);
	float nx = scene(p + eps.xyy) - scene(p - eps.xyy); 
	float ny = scene(p + eps.yxy) - scene(p - eps.yxy); 
	float nz = scene(p + eps.yyx) - scene(p - eps.yyx); 
	return normalize(vec3(nx,ny,nz));
}


void generateFrag() {



	vec3 color = vec3(0); 
	vec2 p = 2.0*(vec2(pyvisualUV.x, 1.0 - pyvisualUV.y) * pyvisualResolution).xy/pyvisualResolution - 1.0; 
	p.x *= pyvisualResolution.x/pyvisualResolution.y; 

	if (abs(p.y) < uBackgroundBorder) {
		vec3 ro = vec3(0.0, 0.0, 2.0); 
		vec3 rd = normalize(vec3(p.x, p.y, -1.4 * uScale)); 

		color = (1.0 - vec3(length(p*0.5)))*0.2;   

		const int steps = 64+32;
		const float epsilon = 0.001;

		vec3 pos = ro; 
		float dist = 0.0;
		float dscene = 0.0;
		float lr = 0.8;

		int i = 0;
		for (; i < steps; i++) {
			dscene = scene(pos);
			if (dscene < epsilon) {
				break;
			}
			pos += rd*dscene * lr;
			dist += dscene * lr;
			lr = max(0.5, lr*0.85);
		}

		if (dist < 100.0 && dscene < epsilon) {
			vec3 n = get_normal(pos);
			vec3 r = reflect(normalize(pos - ro),n); 
			vec3 h = -normalize(n + pos - ro ); 
			float diff  = 1.0*clamp(dot(n, normalize(vec3(1,1,1))), 0.0, 1.0); 
			float diff2 = 0.2*clamp(dot(n, normalize(vec3(0.7,-1,0.5))), 0.0, 1.0); 
			float diff3 = 0.1*clamp(dot(n, normalize(vec3(-0.7,-0.4,0.7))), 0.0, 1.0); 
			float spec = pow(clamp(dot(h, normalize(vec3(1,1,1))), 0.0, 1.0), 50.0); 
			float amb = 0.2 + pos.y; 
			vec3 cubeColor = diff*vec3(1,1,1) + diff2*vec3(1,0,0)  + diff3*vec3(1,0,1) + spec*vec3(1,1,1)  + amb*vec3(0.2,0.2,0.2);
			cubeColor /= dist;
			// count of iterations until convergance as color
			//cubeColor = mix(vec3(1.0, 0.0, 0.0), vec3(0.0, 1.0, 0.0), step(8.0, float(i)));
			// normal as color
			//cubeColor = clamp(dot(n, normalize(vec3(1,1,1))), 0.0, 1.0) * (n + vec3(1.0)) / 2.0 + spec*vec3(1,1,1)  + amb*vec3(0.2,0.2,0.2);
			//dist = clamp(dist, 0.0, 1.0) / 1.0;
			//cubeColor = mix(vec3(1.0, 0.0, 0.0), vec3(0.0, 1.0, 0.0), dist);
			color = mix(color, cubeColor, uAlpha);
		}
	}

	pyvisualOutColor = vec4(color, 1.0); 
}
